import styled  from "styled-components";
import React from "react"

const SearchBarWrapper = styled.div`
border:1px solid black;
border-radius: 20px;
padding:10px;
display:flex;
position:realtive;

`;

const IconImage = styled.img`
height:20px;
padding:20px;
`;

const Input = styled.div`
    flex:1;
    border:none;
    outline:none;
    ;
`;

const RightSide = styled.div`
    display:flex;
    flex:0 0 auto;
    padding-right: 10px;
`;
const SearchBar = ()=>{

    return(

        <SearchBarWrapper>
            <h1> Search Bar</h1>
            <IconImage src="https://image.flaticon.com/icons/png/512/622/622669.png"
            alt ="search-icon"
            />
            <Input/>
        </SearchBarWrapper>
    )
}

export default SearchBar;
